import React, { useState, useEffect } from "react";
import axios from "axios";
function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        axios.get("/fakeData").then((data) => {
            setData(data);
            console.log(data);
        });
    });

    return <div className="App">Hello Yams</div>;
}

export default App;
